package name.zeno.alipay/** * @see [支付宝 App 支付 | 通知参数说明](https://docs.open.alipay.com/204/105301) */class AlipayResult(rawResult: Map<String, String>?) {  /**   * alipay 错误码  [com.alipay.sdk.app.i]   */  var resultStatus: Int = 0    private set  var result: String? = null    private set  var memo: String? = null    private set  init {    if (rawResult != null) {      this.resultStatus = Integer.valueOf(rawResult["resultStatus"] ?: "0")      this.result = rawResult["result"]      this.memo = rawResult["memo"]    }  }}